- TRANSPOSICÃO DO RIO SÃO-FRANCISCO:
. Iniciada em 2007, retomada em 2019 e concluída em 2021, com 477 km de canais;

. Contratação de obras acessórias (não previstas antes) com canais nos estados de alagoas, Paraíba, Rio Grande do Norte, Bahia, Sergipe e Ceará;

. R$ 4.8 bilhões de reais investidos em nosso Governo;

. 16 milhões de pessoas alcançadas (28% da população da região Nordeste);

- EFICIÊNCIA E MAIS RESULTADOS POSITIVOS AO POVO!

. 8.1 milhões de empresas abertas em 3 anos (média de 2,7 milhões por ano);

 . Nos governos do PT foram 8 milhões em 14 anos (média de 0,57 milhões por ano);

. Programas de preservação de emprego salvaram 10 milhões de empresas da falência;

. Mais de 5 milhões de empregos gerados em 4 anos;

. Mais de 100 milhões de empregados no país. O maior número na história do país.

. Desburocratizações recordes, lei da liberdade econômica beneficiando o pequeno empreendedor e digitalizações diminuindo custos a cada Brasileiro.

- MAIS NÚMEROS SOBRE SEGURANÇA PÚBLICA DURANTE NOSSA GESTÃO:

. R$ 5,4 bilhões Investidos em segurança entre 2019 e 2021;

. Menor número de assassinatos desde 2011.

. Maior redução no número de homicídios da história recente;

. Mais de R$1,5 bilhão foram repassados para as polícias estaduais;

. Prejuízo de R$ 30,7 bilhões ao crime organizado incluindo tráfico de drogas;

. Criação do Programa Vigia, desarticulando o tráfico nas fronteiras; Intensificação do número de operações da Força Nacional de 46 (2018) para 96 (2021).

