As principais conclusões dos "grandes jornalistas das maiores emissoras e jornais do Brasil:

1-Inflação ajuda os pobres;
2- Aumento de combustível é coisa boa;
3- Cenário econômico é desastroso, mas é positivo;
4- Desemprego é alto, mas está baixo;
5- Tomar calote de bilhões para ditaduras é investimento.
6- Governo Bolsonaro reduziu inflação, violência e desemprego, mas foi ruim;
7- Desgoverno stalinista, em menos de três meses, aumentou inflação, violência e desemprego, mas é bom;
8- Velhinhas de verde e amarelo são "terroristas";
9- Terroristas invadindo terras são "manifestantes".
10- Bandidos armados não é problema;
11- Cidadão honesto com arma legal é um perigo;
12- Banco Central é inimigo do povo;
13- Molusco é um grande estadista.

