Essas são as mulheres da minha vida, e é pela garantia dos direitos delas e de tantas outras brasileiras, que luto todos os dias.

🇧🇷Aproveito para apresentar algumas ações do governo Bolsonaro para as mulheres. LEGADO que ninguém apagará:

- Auxílio Emergencial de R$ 1200 para mulher chefe de família;
- Oito em cada dez famílias do Auxílio Brasil chefiadas por mulheres;
- Mais de R$ 227,1 milhões foram investidos em políticas públicas para mulheres;
- Casas da Mulher Brasileira tiveram investimento de R$ 103 milhões do Governo Bolsonaro e execução orçamentária recorde de 98,6%;
- Qualifica Mulher: investimento de R$ 69,5 milhões garantiu capacitação profissional para mais de 301,5 mil mulheres;
- Ministério da Saúde investiu mais de R$ 1,8 bilhão para ampliar cuidado com a saúde das mulheres de todo Brasil;
- Brasil reduziu 8,4% a razão de mortalidade materna e investe em ações com foco na saúde da mulher;
- Mais de 400 mil títulos de terras entregues no país, grande parte destinados a mulher;
- Em 2022, o Brasil ultrapassou a marca de 40 milhões de mulheres no mercado de trabalho.

- Comparativo do valor de vários indicadores econômicos em 2018 e 2022. Entre esses anos ocorreu a maior epidemia desde 1918, a maior crise hídrica em 100 anos e a maior guerra do século.

- Com tudo isso a economia brasileira cresceu e gerou empregos e renda.

- Brasil: 2018 × 2022:

. (Gasto do Governo)/PIB: 19,4% (2018) × 18,9% (2022);

. Primeira vez que um governo termina seu ciclo de 4 anos gastando menos do que quando entrou (e lembrando que 2022 foi ano de eleição presidencial);

. Dívida Bruta do Governo Geral)/PIB: 75,3% (2018) × 72,9% (2022). Isso com pandemia, maior crise hídrica em 100 anos e guerra na Ucrânia;

. Número de Empresas estatais: 213 (2018) × 130 (2022);

. Redução de quase 40% no número de empresas estatais;

. Taxa de Investimento: 15,8% (2018) × 19,6% (39 Trimestre 2022);

. 3• Trimestre de 2022 foi a maior taxa de investimento em 8 anos;

. (Exportações + Importações)/PIB: 22,7% (2018) × 34,2%;

. Maior grau de abertura econômica dos últimos 40 anos;

. PIB: +1,8% (2018) × +2,9% (2022);

. Desemprego: 12,3% (2018) × 8,1% (2022);

. Menor taxa de desemprego em 7 anos;

. Pela primeira vez na história a inflação brasileira ficou ABAIXO da americana;

. De 2018 a 2022 o número de brasileiros investindo em Bolsa aumentou 6 vezes, e o volume negociado em renda variável em 7,5 vezes.

