HOJE comemoramos o DIA MUNDIAL DA CONSCIENTIZAÇÃO DAS DOENÇAS RARAS. Segundo a Organização Mundial de Saúde (OMS), uma doença é classificada como rara quando afeta até 65 pessoas em cada 100 mil indivíduos, ou seja, 1,3 para cada 2 mil pessoas. O mundo tem cerca de 300 milhões de pessoas com Doenças Raras e no Brasil, quase 13 milhões de pessoas convivem com alguma condição rara.
⠀
A melhor forma de ajudar é compartilhar informação e fomentar o conhecimento sobre as doenças raras existentes no mundo, combatendo o preconceito e apoiando os pacientes e familiares nesta situação.
⠀
Contem sempre com meu apoio e parabéns a todos voluntários que trabalham em prol dessa causa.
